import React, { useEffect } from 'react';
import Invoices from './components/Invoices/Invoices';
import InvoiceDetailes from './components/InvoiceDetailes/InvoiceDetailes';
import Form from './components/Form/Form';
import PermanentDrawerLeft from './components/Drawer/PermanentDraweLeft';
import Navbar from './components/NavbarSmallScreen/Navbar';
import Auth from './components/Auth/Auth';
import { getInvoices } from './actions/invoices';
import { useDispatch, useSelector } from 'react-redux';
import { ThemeProvider } from '@material-ui/core/styles';
import { darkTheme, lightTheme } from './Theme';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from 'react-router-dom';
import { Box, Container } from '@material-ui/core';
import useStyles from './styles';

const App = () => {
  const classes = useStyles();
  const dispatch = useDispatch();
  const isDarkMode = useSelector((state) => state.globalState.isDarkMode);
  const authData = useSelector((state) => state.authReducer.authData);

  useEffect(() => {
    dispatch(getInvoices());
    // eslint-disable-next-line
    const getProducts = () => {
      fetch(
        'https://kohls.p.rapidapi.com/products/list?limit=24&offset=1&dimensionValueID=AgeAppropriate%3ATeens',
        {
          method: 'GET',
          headers: {
            'x-rapidapi-host': 'kohls.p.rapidapi.com',
            'x-rapidapi-key':
              'bdaad2bf95mshcc882269e544183p1df0a7jsn630a96e089b1',
          },
        }
      )
        .then((response) => {
          console.log(response);
        })
        .catch((err) => {
          console.error(err);
        });
    };
    getProducts();
  }, []);

  return (
    <ThemeProvider theme={isDarkMode ? darkTheme : lightTheme}>
      <Router>
        <Box bgcolor="info.main" className={classes.root}>
          <Navbar />
          <Container className={classes.container}>
            <PermanentDrawerLeft />
            <Switch>
              <Route path="/" exact>
                {authData ? <Invoices /> : <Redirect to="/auth" />}
              </Route>
              <Route path="/auth" exact>
                <Auth />
              </Route>
              <Route path="/invoices/:id" exact>
                {authData ? <InvoiceDetailes /> : <Redirect to="/login" />}
              </Route>
            </Switch>
            <Form />
          </Container>
        </Box>
      </Router>
    </ThemeProvider>
  );
};

export default App;
